--
-- Table structure for table `portfolio_historical_holdings`
--

DROP TABLE IF EXISTS `portfolio_historical_holdings`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `portfolio_historical_holdings` (
  `client_id` int(11) NOT NULL COMMENT 'Client ID for reference unique',
  `portfolio_id` int(3) NOT NULL COMMENT 'Portfolio No unique',
  `security_id` varchar(70) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Security Id',
  `security_buy_date` date NOT NULL COMMENT 'Security Buy Date',
  `security_name` varchar(70) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Security Name',
  `security_asset_class` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Security Asset Class',
  `security_asset_sub_class` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Security Asset Sub Class',
  `security_sector_name` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Security Sector Name',
  `security_industry_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Security Industry Name',
  `security_quantity` float DEFAULT NULL COMMENT 'Security Quantity',
  `security_buy_rate` float DEFAULT NULL COMMENT 'Security Buy Rate per Quantity',
  `security_brokerage` float DEFAULT NULL COMMENT 'Brokerage for buy',
  `security_tax` float DEFAULT NULL COMMENT 'Tax for buy',
  `security_total_cost` float DEFAULT NULL COMMENT 'Security Total Cost (Buy Rate*Quantity) + Brokerage + Tax',
  `security_cost_rate` float DEFAULT NULL COMMENT 'Security effective cost per quantity i.e. Total Cost/Quantity',
  `security_sell_date` date NOT NULL COMMENT 'Security Sell Date',
  `security_sell_rate` float DEFAULT NULL COMMENT 'Security Sell Rate per Quantity',
  `security_brokerage_sell` float DEFAULT NULL COMMENT 'Brokerage for sell',
  `security_tax_sell` float DEFAULT NULL COMMENT 'Tax for sell',
  `security_net_sell` float DEFAULT NULL COMMENT 'Security Total Sell (Sell Rate*Quantity) - Brokerage - Tax',
  `security_net_sell_rate` float DEFAULT NULL COMMENT 'Security effective sell per quantity i.e. Net Sell/Quantity',
  `security_holding_period` float DEFAULT NULL COMMENT 'Security holding period in years i.e. Buy date to till date ',
  `security_realized_net_profit` float DEFAULT NULL COMMENT 'Realized Net Profit = Market Value - Total Cost',
  `security_absolute_return` float DEFAULT NULL COMMENT 'Realized absolute return',
  `security_annualized_return` float DEFAULT NULL COMMENT 'Realized annualized return',
  `fin_year` varchar(9) COLLATE utf8_unicode_ci NOT NULL COMMENT 'FIN Year when security was sold',
  PRIMARY KEY (`client_id`,`portfolio_id`,`security_id`,`security_buy_date`,`security_sell_date`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Portfolio Historical Holdings';
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `portfolio_historical_holdings`
--

