--
-- Table structure for table `portfolio_holdings`
--

DROP TABLE IF EXISTS `portfolio_holdings`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `portfolio_holdings` (
  `client_id` int(11) NOT NULL COMMENT 'Client ID for reference unique',
  `portfolio_id` int(3) NOT NULL COMMENT 'Portfolio No unique',
  `security_id` varchar(70) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Security Id',
  `security_buy_date` date NOT NULL COMMENT 'Security Buy Date',
  `security_name` varchar(70) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Security Name',
  `security_asset_class` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Security Asset Class',
  `security_asset_sub_class` varchar(30) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Security Asset Sub Class',
  `security_sector_name` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Security Sector Name',
  `security_industry_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Security Industry Name',
  `security_quantity` float DEFAULT NULL COMMENT 'Security Quantity',
  `security_buy_rate` float DEFAULT NULL COMMENT 'Security Buy Rate per Quantity',
  `security_brokerage` float DEFAULT NULL COMMENT 'Security Total Brokerage',
  `security_tax` float DEFAULT NULL COMMENT 'Security Total Tax',
  `security_total_cost` float DEFAULT NULL COMMENT 'Security Total Cost (Buy Rate*Quantity) + Brokerage + Tax',
  `security_cost_rate` float DEFAULT NULL COMMENT 'Security effective cost per quantity i.e. Total Cost/Quantity',
  `security_cmp` float DEFAULT NULL COMMENT 'Security Current Market Price',
  `security_market_value` float DEFAULT NULL COMMENT 'Security market value (CMP*Quanity)',
  `security_holding_period` float DEFAULT NULL COMMENT 'Security holding period in years i.e. Buy date to till date ',
  `security_unrealized_net_profit` float DEFAULT NULL COMMENT 'Unrealized Net Profit = Market Value - Total Cost',
  `security_absolute_return` float DEFAULT NULL COMMENT 'Unrealized absolute return',
  `security_annualized_return` float DEFAULT NULL COMMENT 'Unrealized annualized return',
  `security_maturity_value` float DEFAULT NULL COMMENT 'Security Maturity Value especially for FDs',
  `security_maturity_date` date DEFAULT '1900-01-01' COMMENT 'Security Maturity Value especially for FDs',
  PRIMARY KEY (`client_id`,`portfolio_id`,`security_id`,`security_buy_date`),
  KEY `c_portfolio_holdings_portfolio_id` (`portfolio_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Portfolio Current Holdings';
/*!40101 SET character_set_client = @saved_cs_client */;

